desc:
Преимущества этого комплекта очень разнообразны. Они могут увеличивать или уменьшать свет, делать затенение, устранять излишнее покраснение, осветлять слишком темные участки, увеличивать яркость всех цветов, делать кожу светлее, мягче, придавать ей более здоровый оттенок и т. д. Предусмотрены предварительные настройки Lightroom для портретов.  чтобы придать вашим фотографиям мягкий, сияющий эффект. 

Что включено в пакет:

    40 лучших пресетов Lightroom для портретов;
    Бесплатные бонусы в виде 70 пресетов Black &amp; White Lightroom;

    Совместим с версиями Adobe LR 4,5,6 и CC;
    Они идеально подходят как для Mac, так и для Windows;
    Вы можете использовать предустановки для фотографий RAW, JPEG,TIFFи PNG
